import React from 'react';

const Jumbotron = () => (
  <div className="jumbotron">
    <p className="lead text-center"><font color="#FF8C00">Try to click each card one time! Click a card twice and the game restarts!</font></p>
    <img src="data:image/jpeg;base64," alt="Girl in a jacket" width="150" height="150"></img>
  </div>
);

export default Jumbotron;
